import React from 'react'
import axios from 'axios'

export default function PlayerInfo({ player }){

    const getPlayerInfo = async (player) => {
        const result = await axios.get(`https://localhost:5000/player?info=${player.id}`)
    }

    return (
        <div>
            {getPlayerInfo(player)}
        </div>
    )
}
